min-version: '1.4'
class: ArcGISVector
sources:
  open-data:
    host: services.thelist.tas.gov.au
    folder: Public
    service: OpenDataWFS
  topography:
    host: services.thelist.tas.gov.au
    folder: Public
    service: TopographyAndRelief
  cadastre-administrative:
    host: services.thelist.tas.gov.au
    folder: Public
    service: CadastreAndAdministrative
  placenames:
    host: services.thelist.tas.gov.au
    folder: Public
    service: PlacenamePoints
  geoscience-australia:
    host: services.ga.gov.au
    instance: site_7
    service: Topographic_Base_Map_WM
features:
  urban-areas:
    source: cadastre-administrative
    name: Land Use 2009-2010
    where: LU_CODE IN ('5.4.1')
  contours-5m:
    name: LIST Contours 5m
    category: CONTOUR_TY
    label: ELEVATION
  contours-10m:
    name: LIST Contours 10m
    category: CONTOUR_TY
    label: ELEVATION
  contours-20m:
    name: LIST Contours 10m
    where: MOD(ELEVATION,20) = 0
    category: CONTOUR_TY
    label: ELEVATION
  coastal-flats:
    name: LIST Hydrographic Areas
    where: HYDARTY1 IN ('Flat')
    category: HYDARTY2
  cadastre:
    name: LIST Cadastral Parcels
    where:
    - CAD_TYPE1 IN ('Private Parcel','Authority Land')
    - TENURE_TY NOT IN ('Marine Crown Land','Tidal Crown Land','Crown Land','Vertical Strata','Horizontal Strata')
    - STRATA_LEV IN ('Not Applicable')
  wetlands:
  - name: LIST Hydrographic Areas
    where: HYDARTY2 IN ('Swamp','Wet area')
    category: HYDARTY2
  - source: placenames
    name: Placenames
    where: FEAT_TYPE IN ('Wetland')
    label-only: true
    label: FEAT_NAME
  water-tunnels:
    name: LIST Hydrographic Lines
    where:
    - HYDLNTY1 IN ('Artificial Watercourse')
    - HYDLNTY2 IN ('Water pipeline','Siphon','Water tunnel')
    - RELGRND IN ('Under','Unknown')
  watercourses:
  - name: LIST Hydrographic Lines
    where:
    - HYDLNTY1 IN ('Artificial Watercourse','Watercourse')
    - HYDLNTY2 NOT IN ('Implied','Water pipeline','Penstock','Siphon','Water tunnel')
    - RELGRND NOT IN ('Under')
    category: 1d
    label: NAME
  - name: LIST Hydrographic Areas
    where:
    - HYDARTY1 IN ('Artificial Watercourse','Watercourse')
    - HYDARTY2 NOT IN ('Spillway')
    - PERENNIAL NOT IN ('Intermittent')
    category: 2d
    label-only: true
    label: NAME
  # TODO: ??? complete watercourse labeling?
  waterbodies:
  - name: LIST Hydrographic Areas
    where:
    - HYDARTY1 IN ('Artificial Watercourse','Watercourse','Water Body','Estuary')
    - HYDARTY2 NOT IN ('Spillway')
    - PERENNIAL NOT IN ('Intermittent')
    category: Perennial
  - name: LIST Hydrographic Areas
    where:
    - HYDARTY1 IN ('Artificial Watercourse','Watercourse','Water Body')
    - PERENNIAL IN ('Intermittent')
    category: PERENNIAL
  - name: LIST Hydrographic Areas
    where: HYDARTY1 IN ('Sea')
    per-page: 1
    category: Perennial
  - source: placenames
    name: Placenames
    where: FEAT_TYPE IN ('Bay','Estuary','Passage','Rip','Water Body')
    category: FEAT_TYPE
    label-only: true
    label: FEAT_NAME
  submerged-trees:
    name: LIST Hydrographic Areas
    where: HYDARTY1 IN ('Submerged Tree')
  dams:
  - name: LIST Hydrographic Lines
    where: HYDLNTY1 IN ('Dam')
    category:
    - 1d
    - HYDLNTY2
  - name: LIST Hydrographic Areas
    where: HYDARTY1 IN ('Dam') OR HYDARTY2 IN ('Spillway')
    category:
    - 2d
    - HYDARTY2
  waterfalls-rapids:
  - name: LIST Hydrographic Lines
    where: HYDLNTY1 IN ('Water Fall')
    category: line-waterfall
  - name: LIST Hydrographic Points
    where: HYDPNTTY IN ('Waterfall')
  - name: LIST Hydrographic Areas
    where: HYDARTY1 IN ('Rapid')
    category: rapid
    # TODO: can label these rapids with NAME
    # TODO: include Hydro Points with HYDPNTTY IN ('Rapid')?
  - source: placenames
    name: Placenames
    where: FEAT_TYPE IN ('Waterfall')
    label-only: true
    label: FEAT_NAME
  water-pipelines:
    name: LIST Hydrographic Lines
    where:
    - HYDLNTY1 IN ('Artificial Watercourse')
    - HYDLNTY2 IN ('Water pipeline','Penstock','Siphon')
    - RELGRND IN ('Above','In or on')
  tidal-zones:
    name: LIST Hydrographic Areas
    where:
    - HYDARTY1 IN ('Tidal zone')
    - HYDARTY2 IN ('Rock','Sand','Vegetated mudflat','Unvegetated mudflat')
    category: HYDARTY2
  reefs:
  - name: LIST Hydrographic Areas
    where: HYDARTY1 IN ('Submerged Reef')
    category: HYDARTY1
  - name: LIST Hydrographic Points
    where: HYDPNTTY IN ('Rock','Submerged Rock')
    category: HYDPNTTY
  - source: placenames
    name: Placenames
    where: FEAT_TYPE IN ('Reef')
    label-only: true
    label: FEAT_NAME
  walking-tracks:
    name: LIST Transport Segments
    where: TRANS_TYPE IN ('Track')
    category: TRAN_CLASS
    label: PRI_NAME
  ferry-routes:
    name: LIST Transport Segments
    where:
    - TRANS_TYPE IN ('Route')
    - TRAN_CLASS IN ('Ferry')
  road-tunnels:
    name: LIST Transport Segments
    where:
    - TRANS_TYPE IN ('Road')
    - TSEG_FEAT LIKE '%Tunnel%'
    category: TRAN_CLASS
  railway-tunnels:
    name: LIST Transport Segments
    where:
    - TRANS_TYPE IN ('Rail')
    - TSEG_FEAT LIKE '%Tunnel%'
    category: TRAN_CLASS
  roads:
    name: LIST Transport Segments
    where:
    - TRANS_TYPE IN ('Road')
    - TSEG_FEAT NOT LIKE '%Tunnel%'
    - TSEG_FEAT NOT IN ('Transport Connector')
    category:
    - TRAN_CLASS
    - SURFACE_TY
    label: PRI_NAME
  railways:
    name: LIST Transport Segments
    where:
    - TRANS_TYPE IN ('Rail')
    - TSEG_FEAT NOT LIKE '%Tunnel%'
    category: TRAN_CLASS
  road-bridges:
    name: LIST Transport Segments
    where:
    - TRANS_TYPE IN ('Road')
    - TSEG_FEAT LIKE '%Bridge%'
    category:
    - TRAN_CLASS
    - SURFACE_TY
  railway-bridges:
    name: LIST Transport Segments
    where:
    - TRANS_TYPE IN ('Rail')
    - TSEG_FEAT LIKE '%Bridge%'
    category: TRAN_CLASS
  gates-grids:
    name: LIST Transport Nodes
    where: TNODE_FEAT IN ('Gate','Stock Grid')
    category: TNODE_FEAT
  tanks:
    name: LIST Hydrographic Points
    where: HYDPNTTY IN ('Tank')
  buildings:
  - name: LIST Building Points
    category: BUILD_TY
    where: BUILD_TY NOT IN ('Ruin', 'Walking Hut')
  - name: LIST Building Points
    category: BUILD_TY
    label: BUILD_NAME
    where: BUILD_TY IN ('Walking Hut')
  - name: LIST Building Polygons 2D
  railway-stations:
    name: LIST Transport Nodes
    where: TNODE_FEAT IN ('Railway Station')
    category: STATUS
  transmission-lines:
    source: topography
    name: Transmission Lines
  feature-names:
  - name: LIST Named Feature Extents
    where: TYPE IN ('MOUNTAINS','RIDGE','VALLEY','ISTHMUS','BEACH')
    category: TYPE
    label-only: true
    label: NAME
  - source: placenames
    name: Placenames
    where:
    - FEAT_GROUP IN ('Natural feature')
    - FEAT_CLASS IN ('Elevation','Land Formation','Land formation','Open land','Vegetation')
    - FEAT_TYPE NOT IN ('Mountains','Ridge','Valley','Isthmus')
    category: FEAT_TYPE
    label-only: true
    label: FEAT_NAME
  - source: placenames
    name: Placenames
    where: FEAT_TYPE IN ('Saltpan','Spring','Stream feature')
    category: FEAT_TYPE
    label-only: true
    label: FEAT_NAME
  place-names:
    source: geoscience-australia
    name: Populated_Places_8
    label-only: true
    label: NAME
    category: populated

intervals-contours:
  5: contours-5m
  10: contours-10m
  20: contours-20m
relief-masks:
- waterbodies.Perennial

urban-areas:
  stroke: none
  fill: "#FFCD86"
contours-5m:
  stroke: "#805100"
  stroke-width: 0.12
  [ Index-Contour, Index-Depression-Contour, Index-Depression-Form-Line, Index-Form-Line ]:
    stroke-width: 0.24
  [ Auxiliary-Contour, Auxiliary-Dep-Contour, Intermediate-Dep-Form-Line, Intermediate-Form-Line, Index-Depression-Form-Line, Index-Form-Line ]:
    stroke-dasharray: 3 1
  [ Intermediate-Dep-Contour, Auxiliary-Dep-Contour, Intermediate-Dep-Form-Line, Index-Depression-Contour, Index-Depression-Form-Line ]:
    symbolise:
      interval: 2.0
      line:
        stroke: "#805100"
        stroke-width: 0.12
        y2: 0.3
contours-10m:
  stroke: "#805100"
  stroke-width: 0.12
  [ Index-Contour, Index-Depression-Contour ]:
    stroke-width: 0.24
  [ Intermediate-Dep-Contour, Index-Depression-Contour ]:
    symbolise:
      interval: 2.0
      line:
        stroke: "#805100"
        stroke-width: 0.12
        y2: 0.3
contours-20m:
  stroke: "#805100"
  stroke-width: 0.12
  [ Index-Contour, Index-Depression-Contour ]:
    stroke-width: 0.24
  [ Intermediate-Dep-Contour, Index-Depression-Contour ]:
    symbolise:
      interval: 2.0
      line:
        stroke: "#805100"
        stroke-width: 0.12
        y2: 0.3
